    false,nt"url": null,nt"notes": "This Annual Narrative Report for Malheur
    National Wildlife Refuge summarizes refuge activities during 1978.  The report begins
    with information about the climatic conditions in 1978, land that was acquisitioned
    during the year, and the system status.   Construction and maintenance activities
    are also covered, along with information about wildfires.  The report includes a
    habitat management section which discusses croplands, grasslands, wetlands, forest
    lands, other habitats, and special areas.  Wildlife is outlined with focus on endangered/threatened
    species, migratory birds, non-migratory birds, and mammals.  Interpretation and
    recreation are also covered; law enforcement is described in this section.  Finally,
    information is provided about field investigations, cooperative programs, items
    of interest, and safety.",nt"license_title": "License Not Specified",nt"extras":
